import { BrowserRouter , Routes , Route } from "react-router-dom";
import Main from "./pages/main";
import Balanced from "./pages/balanced";
import Age from "./pages/age";  
import './index.css';
import Theme from "./components/theme";

function App() {
  return (
       <div className="App">
        <Theme/>
<BrowserRouter>
<Routes>
  <Route  index element={<Main/>} path="/"/>
  <Route  element={<Main/>} path="/home"/>
  <Route  element={<Balanced/>} path="/balanced"/>
  <Route  element={<Age/>} path="/age"/> 
</Routes>
</BrowserRouter> 
</div>
  );
}

export default App;
